	const invoiceTable = async () => {
		let res = await axios.get('/api/invoice');
		console.log(res);
	};

	return (
		<div>
			<p>Table</p>
			{invoiceTable()}
		</div>
	);
};
Table.prototype = {};

// const mapStateToProps = state => ({
